import React from 'react'
import "../Register/styles.css"
import Banner from './Banner';
import Footer from './Footer';
import Header from './Header';

function Register() {
  return (
    
    <div className='reg container'>
    <Header/>
    <Banner/>
    <Footer/>
    </div>
   
  
  )
}

export default Register;
